import { useEffect, useState } from "react";
import {
  GET_AGENT_CONVERSIONS_ENTRIES_MOBILE_NUMBER,
  GET_AGENT_CONVERSIONS_ENTRIES_MOBILE_NUMBER_WITH_DATE,
  GET_AGENT_TOTEL_REGISTRATIONS,
  GET_AGENT_TOTEL_REGISTRATIONS_WHEN_DATE_NOT_AVALAIBLE,
  GET_AGENTS_LIST_AGENT_WISE,
  GET_AGENTS_LIST_AGENT_WISE_WITHOUT_DATE,
  GET_AGENTS_LIST_REPORT,
} from "../../apis/Apis";

const AgentReports = () => {
  const [dates, setDates] = useState([]);
  const [selectedDate, setSelectedDate] = useState("");
  const [agentReports, setAgentReports] = useState([]);
  const [loading, setLoading] = useState(true);
  const [agentListLoading, setAgentListLoading] = useState(false);
  // New state for the popup
  const [showPopup, setShowPopup] = useState(false);
  const [serviceProviders, setServiceProviders] = useState([]);
  const [popupLoading, setPopupLoading] = useState(false);

  // New state for conversion entries modal
  const [showConversionModal, setShowConversionModal] = useState(false);
  const [conversionEntries, setConversionEntries] = useState([]);
  const [conversionModalLoading, setConversionModalLoading] = useState(false);

  // Custom styles
  const styles = {
    container: {
      padding: "30px",
      fontFamily: "Arial",
      position: "relative", // Added for popup positioning
    },
    summaryHeading: {
      marginBottom: "20px",
      fontSize: "24px",
      color: "#1f2937",
    },
    loadingMessage: {
      textAlign: "center",
      padding: "20px",
    },
    dataTable: {
      width: "100%",
      borderCollapse: "collapse",
      boxShadow: "0 0 15px rgba(0, 0, 0, 0.1)",
      borderRadius: "8px",
      overflow: "hidden",
      marginTop: "24px",
    },
    tableHeader: {
      background:
        "linear-gradient(to right, rgb(31, 41, 55), rgb(239, 68, 68))",
      color: "white",
      textAlign: "center",
    },
    clickableHeader: {
      padding: "14px",
      minWidth: "130px",
      cursor: "pointer",
    },
    noData: {
      padding: "12px",
      textAlign: "center",
    },
    tableRow: {
      textAlign: "center",
    },
    rowEven: {
      backgroundColor: "#f9fafb",
    },
    rowOdd: {
      backgroundColor: "#ffffff",
    },
    tableCell: {
      padding: "12px",
    },
    activeCell: {
      color: "#059669",
      fontWeight: "500",
    },
    inactiveCell: {
      color: "#dc2626",
      fontWeight: "500",
    },
    clickableCell: {
      cursor: "pointer",
      textDecoration: "underline",
    },
    totalsRow: {
      backgroundColor: "#f3f4f6",
      fontWeight: "bold",
      borderTop: "2px solid #e5e7eb",
      textAlign: "center",
    },
    summaryCards: {
      display: "grid",
      gridTemplateColumns: "repeat(auto-fit, minmax(250px, 1fr))",
      gap: "16px",
      marginTop: "24px",
    },
    summaryCard: {
      padding: "16px",
      borderRadius: "8px",
      boxShadow: "0 2px 5px rgba(0, 0, 0, 0.1)",
    },
    cardTitle: {
      fontSize: "16px",
      fontWeight: "500",
    },
    cardValue: {
      fontSize: "24px",
      fontWeight: "700",
      marginTop: "8px",
      cursor: "pointer", // Added to indicate clickable
    },
    cardBlue: {
      backgroundColor: "#f0f9ff",
      border: "1px solid #bae6fd",
      color: "#0c4a6e",
    },
    cardBlueTitle: {
      color: "#0369a1",
    },
    cardGreen: {
      backgroundColor: "#ecfdf5",
      border: "1px solid #a7f3d0",
      color: "#065f46",
    },
    cardGreenTitle: {
      color: "#059669",
    },
    cardRed: {
      backgroundColor: "#fef2f2",
      border: "1px solid #fecaca",
      color: "#991b1b",
    },
    cardRedTitle: {
      color: "#dc2626",
    },
    cardPurple: {
      backgroundColor: "#f5f3ff",
      border: "1px solid #ddd6fe",
      color: "#5b21b6",
    },
    cardPurpleTitle: {
      color: "#7c3aed",
    },
    selectContainer: {
      marginBottom: "24px",
    },
    formLabel: {
      display: "block",
      marginBottom: "8px",
      fontWeight: "500",
    },
    formSelect: {
      display: "block",
      width: "100%",
      maxWidth: "400px",
      padding: "10px",
      borderRadius: "6px",
      border: "1px solid #d1d5db",
      fontSize: "16px",
    },
    // New styles for popup
    popupOverlay: {
      position: "fixed",
      top: 0,
      left: 0,
      right: 0,
      bottom: 0,
      backgroundColor: "rgba(0, 0, 0, 0.5)",
      display: "flex",
      justifyContent: "center",
      alignItems: "center",
      zIndex: 1000,
    },
    popupContent: {
      backgroundColor: "white",
      borderRadius: "8px",
      padding: "24px",
      width: "90%",
      maxWidth: "80vw",
      maxHeight: "80vh",
      overflow: "auto",
      position: "relative",
      boxShadow: "0 4px 20px rgba(0, 0, 0, 0.2)",
    },
    popupHeader: {
      display: "flex",
      justifyContent: "space-between",
      alignItems: "center",
      marginBottom: "20px",
    },
    popupTitle: {
      fontSize: "20px",
      fontWeight: "bold",
      color: "#1f2937",
    },
    closeButton: {
      background: "none",
      border: "none",
      fontSize: "24px",
      cursor: "pointer",
      color: "#6b7280",
    },
    popupTable: {
      width: "100%",
      borderCollapse: "collapse",
      borderRadius: "8px",
      overflow: "hidden",
      boxShadow: "0 0 10px rgba(0, 0, 0, 0.05)",
    },
    popupTableHeader: {
      background: "#f3f4f6",
      textAlign: "left",
    },
    popupTableHeaderCell: {
      padding: "12px 16px",
      fontWeight: "500",
      color: "#1f2937",
    },
    popupTableRow: {
      borderBottom: "1px solid #e5e7eb",
    },
    popupTableCell: {
      padding: "12px 16px",
      textAlign: "left",
      verticalAlign: "top",
    },
    addressCell: {
      maxWidth: "300px",
      whiteSpace: "normal",
      lineHeight: "1.5",
    },
  };

  const getAgentConversionReport = async (data) => {
    setPaymentFilter("All")
    try {
      setConversionModalLoading(true);
      setShowConversionModal(true);
      let res;

      if (selectedDate) {
        res = await GET_AGENT_CONVERSIONS_ENTRIES_MOBILE_NUMBER_WITH_DATE({
          date: data.date,
          agent_number: data.agent_number,
        });
      }else{
        res = await GET_AGENT_CONVERSIONS_ENTRIES_MOBILE_NUMBER({
            mobile_number: data.agent_number,
          });
      }

      /* eslint-disable */console.log(...oo_oo(`3149299321_258_6_258_54_4`,res, "Agent conversion report Data"));

      if (res.status_code === 200 && res.data) {
        setConversionEntries(res.data);
      }
    } catch (error) {
      /* eslint-disable */console.log(...oo_oo(`3149299321_264_6_264_24_4`,error));
    } finally {
      setConversionModalLoading(false);
    }
  };

  useEffect(() => {
    // Load the dates list
    getDatesList();

    // By default, show agent list without date
    getAgentsWithoutDate();
  }, []);

  // Load dates list on component mount
  const getDatesList = async () => {
    try {
      setLoading(true);
      const res = await GET_AGENTS_LIST_REPORT();
      /* eslint-disable */console.log(...oo_oo(`3149299321_283_6_283_48_4`,res, "First api - dates list"));

      if (res.status_code === 200 && res.data && res.data.length > 0) {
        setDates(res.data);
      }
    } catch (err) {
      /* eslint-disable */console.log(...oo_oo(`3149299321_289_6_289_22_4`,err));
    } finally {
      setLoading(false);
    }
  };

  // Fetch agents for a specific date
  const getAgentsByDate = async (date) => {
    try {
      setAgentListLoading(true);
      const res = await GET_AGENTS_LIST_AGENT_WISE({
        date: date,
      });
      /* eslint-disable */console.log(...oo_oo(`3149299321_302_6_302_60_4`,res, "Second api - agents for date", date));

      if (res.status_code === 200 && res.data) {
        setAgentReports(res.data);
      }
    } catch (err) {
      /* eslint-disable */console.log(...oo_oo(`3149299321_308_6_308_22_4`,err));
    } finally {
      setAgentListLoading(false);
    }
  };

  // Get agents list without date (default view)
  const getAgentsWithoutDate = async () => {
    try {
      setAgentListLoading(true);
      const res = await GET_AGENTS_LIST_AGENT_WISE_WITHOUT_DATE();
      /* eslint-disable */console.log(...oo_oo(`3149299321_319_6_319_59_4`,res, "Default api - agents without date"));

      if (res.status_code === 200 && res.data) {
        setAgentReports(res.data);
      }
    } catch (err) {
      /* eslint-disable */console.log(...oo_oo(`3149299321_325_6_325_22_4`,err));
    } finally {
      setAgentListLoading(false);
    }
  };

  // Handle date selection change
  const handleDateChange = (e) => {
    const newSelectedDate = e.target.value;
    setSelectedDate(newSelectedDate);

    if (newSelectedDate) {
      getAgentsByDate(newSelectedDate);
    } else {
      // If "All Dates" is selected
      getAgentsWithoutDate();
    }
  };

  // Calculate total registrations from all agents
  const totalRegistrations = agentReports.reduce(
    (sum, agent) => sum + agent.totalRegistrations,
    0
  );

  // Calculate total conversion entries from all agents
  const totalConversionEntries = agentReports.reduce(
    (sum, agent) => sum + agent.agentConversionEntries,
    0
  );

  // New function to fetch and display service providers
  const getTotalRegistrations = async (data) => {
    /* eslint-disable */console.log(...oo_oo(`3149299321_358_4_358_46_4`,selectedDate, "selected date"));
    /* eslint-disable */console.log(...oo_oo(`3149299321_359_4_359_33_4`,data, "selected"));

    try {
      setPopupLoading(true);
      setShowPopup(true);

      let res;

      if (selectedDate) {
        // Call API when selectedDate is available
        res = await GET_AGENT_TOTEL_REGISTRATIONS(data);
      } else {
        // Call alternate API when selectedDate is not available
        res = await GET_AGENT_TOTEL_REGISTRATIONS_WHEN_DATE_NOT_AVALAIBLE({
          agent_number: data?.agent_number,
        });
      }

